import React from 'react';

class Image extends React.Component {
  render() {
    // Формируем путь к изображению динамически
    const imagePath = require(`../img/fun_cat/${this.props.image}`).default;

    return (
      <img src={imagePath} alt="Cute Image" className="cute-image" />
    );
  }
}

export default Image;
